import React, { useState } from 'react';

import aggregateEvents from '../helpers/dataAggregator';

const DisplayData = (props) => {
    const [eventMap, setEventMap] = useState(new Map());
    const [eventSet, setEventSet] = useState(new Set());

    const displayEvents = () => {
        const listItems = props.data.map((item, idx) => 
            <li key={idx}>{item.summary}</li>
        );
        return (
            <ul>{listItems}</ul>
        )
    }

    const displayAggregations = () => {
        const [eMap, eSet] = aggregateEvents(props.data.items);
        setEventMap(eMap);
        setEventSet(eSet);
    }

    return (
        <div>
            {displayEvents()}
        </div>
    );
}

export default DisplayData;
